import React, { Component } from "react";
import { View, Text } from "react-native";
class AppText extends Component {
  render() {
    return (
      <AppText>
        <Text style={{ fontSize: 10, fontFamily: "courier" }}>
          {this.props.children}
        </Text>
      </AppText>
    );
  }
}

export default AppText;
